export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},CIBff6fiGj:{data:{id:1462,attributes:{imdbId:"tt2398231",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTQ4NTkxOTEyMl5BMl5BanBnXkFtZTgwOTI1NzcwMzE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"80%"},{Source:"Metacritic",Value:"68\u002F100"}],item_lang:{data:{id:2125,attributes:{title:e,plot:"Nebraska, 1854. As the cold, snowy chill begins to settle, Mary Bee Cuddy, an independent, lonely yet strong-willed former teacher, undertakes to escort three women suffering from prairie madness to Lady's Aid Society Methodist Church, Hebron, Iowa. As Mary embarks on a long, challenging, and peril-laden journey, an unexpected ally in the shape of a claim jumper crosses paths with her: rugged George Briggs. However, whatever may be their fate, nothing will ever be the same again. What will it take to reach Altha Carter, the compassionate wife of the church's reverend?",slug:"the-homesman"}}},books:{data:[{id:7768,attributes:{title:e,description:"Four women in the isolated frontier territory go mad, and it is up to the unlikely combination of homesteader Mary Bee Cuddy and ne'er-do-well Briggs to escort them east to safety.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=svDKAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:"2014-02-11",publisher:h,subtitle:"A Novel"}},{id:7769,attributes:{title:e,description:"The Homesman is a devastating, humane story of early pioneers to America's West in the 1850's. It celebrates the ones we hear nothing of-the brave women whose hearts and minds were broken by that life of bitter hardship. When a nineteen-year-old mother loses her three children to diphtheria in three days, or a woman left alone for two nights has to shoot wolves as they crash through the window, it is no wonder they should lose their minds. After a dreadful winter, the Rev. Dowd finds there are four such cases in his parish and, as yet, no asylum in this frontier town. A 'homesman' must be found to escort the women East to civilization. Not a job anyone would volunteer for, it falls to Mary Bee Cuddy, ex-teacher, spinster-indomitable, resourceful, \"plain as an old tin pail.\" Brave as she is, Mary Bee knows she cannot succeed alone, and the only companion available is the low-life and untrustworthy \"George Briggs,\" a claim-jumper.Thus begins a trek East, against the tide of colonization, against hardship, Indian attacks, ice storms, loneliness, and the unceasing aggravation of a disparate group of mad women, which provides a series of tough, fast-paced adventures and introduces two wonderful, idiosyncratic characters. Coming to cinemas in 2014 with an incredible cast - featuring Tommy Lee Jones, Meryl Streep, Hilary Swank and John Lithgow. Not to be missed!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=D3R0AwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2014-09-11",publisher:h,subtitle:a}},{id:7770,attributes:{title:i,description:a,thumbnail:a,authors:[c],firstBook:d,published:"2021-01-07",publisher:a,subtitle:a}},{id:7771,attributes:{title:"De homesman",description:"Nebraska, 1850. Boeren en goudzoekers trekken steeds verder naar het westen maar de winter is zo onbarmhartig dat vier vrouwelijke pioniers hun verstand verliezen en naar de bewoonde wereld moeten worden teruggebracht. De ongetrouwde Mary Bee Cuddy heeft geen andere keus dan de rol van homesman op zich te nemen, en wordt tegen wil en dank bijgestaan door George Briggs, een onverbeterlijke schooier. Zo begint een bizarre reis vol beproevingen: Mary en George delen de zorg voor een groep krankzinnige vrouwen, maar binden ook de strijd aan met de elementen, de eenzaamheid en, bovenal, elkaar.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=d_YHBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2014-07-15",publisher:"Singel Uitgeverijen",subtitle:a}},{id:7772,attributes:{title:i,description:"Au cœur des grandes plaines de l'Ouest, au milieu du XIXe siècle, Mary Bee Cuddy est une ancienne institutrice solitaire qui a appris à cultiver sa terre et à toujours laisser sa porte ouverte. Cette année-là, quatre femmes, brisées par l'hiver impitoyable et les conditions de vie extrêmes sur la Frontière, ont perdu la raison. Aux yeux de la communauté des colons, il n'y a qu'une seule solution : il faut rapatrier les démentes vers l'Est, vers leurs familles et leurs terres d'origine. Mary Bee accepte d'effectuer ce voyage de plusieurs semaines à travers le continent américain. Pour la seconder, Briggs, un bon à rien, voleur de concession voué à la pendaison, devra endosser le rôle de protecteur et l'accompagner dans son périple. Inoubliable portrait d’une femme hors du commun et de son compagnon taciturne, aventure et quête à rebours, Homesman se dévore de la première à la dernière page.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=275HDAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Glendon SWARTHOUT"],firstBook:d,published:"2016-06-02",publisher:"Éditions Gallmeister",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703577142}}("","movie","Glendon Swarthout",null,"The Homesman","series",1,"Simon and Schuster","Homesman"))